CREATE TABLE Users(userID SERIAL,userName TEXT,email TEXT UNIQUE,password TEXT,rating REAL DEFAULT 0,PRIMARY KEY(userID));
CREATE TABLE Recipes(recipeID SERIAL,chefID INTEGER NOT NULL,recipeName TEXT,foodType TEXT,pictureUrl TEXT,ingredients TEXT[],protein REAL,carbs REAL,fat REAL,sugars REAL,PRIMARY KEY(recipeID),FOREIGN KEY (chefID) REFERENCES Users ON DELETE CASCADE);
CREATE TABLE Bookmarks(userID INTEGER,recipeID INTEGER,PRIMARY KEY(userID, recipeID),FOREIGN KEY (userID) REFERENCES Users ON DELETE CASCADE,FOREIGN KEY (recipeID) REFERENCES Recipes ON DELETE CASCADE);
